import classes from './NavigationBar.module.css';

// const iconPath = "../../assets/favicon-32x32.png";
function NavigationBar() {
  return (
    <header>
        <nav class={classes.navbar}>
            <div className={classes.navbar__right}>
                Spencer Josi
            </div>
            <div className={classes.navbar__left}>
                <a href="about" className={classes.link}>About</a>
                <a href="#experience" className={classes.link}>Experience</a>
                <a href="#skills" className={classes.link}>Skills</a>
                <a href="#contact" className={classes.link}>Contact</a>
            </div>
        </nav>
    </header>
  );
}

export default NavigationBar;
